import React from 'react'
import { Line } from "react-chartjs-2";

function Chart(props) {
    const sickData = props.countryInfo.country[0];
    const deadData = props.countryInfo.country[1];
    const recoveredData = props.countryInfo.country[2];

    console.log(sickData)
    console.log(deadData)
    console.log(recoveredData)

    const sickLabels = sickData.history[0]
    const dataSet = sickData.history[1];

    const data = {
        labels: sickLabels,
        dataSet: dataSet
    }

    return (
        <div>
            <Line data={data} options={{responsive: true}}/>
        </div>
    )
}

export default Chart
